import React, { Component } from 'react'; // Import React explicitly for older React versions
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [
        { name: 'Jack', id: '1' },
        { name: 'Frank', id: '2' },
        { name: 'Jacky', id: '3' },
        { name: 'Mike', id: '4' },
        { name: 'Jana', id: '5' },
        { name: 'Kyra', id: '6' },
      ],
    };
  }

  render() {
    return (
      <div className="App">
        {this.state.monsters.map((monster) => (
          <h1 key={monster.id}>{monster.name}</h1> // Dynamically render each monster's name
        ))}
      </div>
    );
  }
}

export default App;
